export default function Skills(props) {
  const skills = props.propsSkills
  const programmingLanguagesArray = skills.programmingLanguages.map(item => (
    <>
    <p>{item}</p>
    <li key={item.id}>{item.name}</li>
    </>
  ))
  const frameworksArray = skills.frameworks.map(item => <li key={item.id}>{item.name}</li>)
  const versionControlArray = skills.versionControl.map(item => <li key={item.id}>{item.name}</li>)
  const osArray = skills.os.map(item => <li key={item.id}>{item.name}</li>)
  const databaseArray = skills.database.map(item => <li key={item.id}>{item.name}</li>)
  const biToolsArray = skills.biTools.map(item => <li key={item.id}>{item.name}</li>)
  const analyticalSkillsArray = skills.analyticalSkills.map(item => <li key={item.id}>{item.name}</li>)
  return (
    <section id="skills" className="relative flex flex-col items-center justify-center gap-12 min-h-[50vh] py-16">
      <div className="mx-auto flex max-w-screen-sm flex-col gap-8 px-4 py-8">
        <h2 className="mx-auto max-w-prose">
          <span className="block text-center text-base font-semibold uppercase tracking-wide text-blue-600 dark:text-blue-400">Most Developed</span>
          <span className="mt-2 block text-center text-3xl font-extrabold leading-8 tracking-tight sm:text-4xl">Skills</span>
        </h2>
        <p className="tracking-wide leading-relaxed text-lg">Programming Languages</p>
        <div className="flex w-full flex-row flex-wrap items-center justify-center gap-4">
          <ul>
            {programmingLanguagesArray}
          </ul>
        </div>
      </div>
    </section>
  )
}
